import React, { Fragment } from "react";

function AddServer()
{
	return (
		<Fragment>
		<h1 className="text-center mt-5">Servers</h1>
		<form>
			<input type="text" className="form-control" />
			<button>Add</button>
		</form>
		</Fragment>
	);
}

export default AddServer;
